import React from "react";
import "./SearchBar.scss";
import shipments from "../../../assets/data/shipments.json";
import SearchBarItems from "./SearchBarItems/SearchBarItems";

const shipmentsArray = Object.values(shipments);
const shipmentsArray2 = Object.values(shipments);


const SearchBar = () => {
  console.log(shipmentsArray[0].name)

  const handleTyping = (event) => {
    console.log(event.target.value)
    console.log(shipmentsArray2)
  }

  
  return (
    <div>
      <form className="form-search">
        <input className="input-search" id="search-input" onChange={handleTyping} type="search" placeholder="Search" />
        
        {shipmentsArray[0].map((el) => (
          <SearchBarItems key={el.name} url={el.id} name={el.name} />
        ))}
      </form>
    </div>
  );
};

export default SearchBar;
